                        "Desc": "戦況に応じて、ディシアが独自に編み出したさまざまな戦闘技を繰り出す。<br><br><color style='color:#FFD780;'>浄焔怒涛</color><br>フィールド上にディシア自身の「浄焔剣獄」が存在しない時に繰り出される。<br><color style='color:#FF9999;'>炎元素範囲ダメージ</color>を与え、「浄焔剣獄」領域を生成する。<br><br><color style='color:#FFD780;'>剣域熾焔</color><br>フィールド上にディシア自身の「浄焔剣獄」が存在する時に繰り出される。<br>跳躍攻撃を行い、<color style='color:#FF9999;'>炎元素範囲ダメージ</color>を与え、新たな位置に「浄焔剣獄」領域を再生成する。<br>この方法で再生成された「浄焔剣獄」領域は元の領域の継続時間を引き継ぐ。<br><br>1回の「浄焔剣獄」継続時間中に剣域熾焔は1回のみ発動可能。<br><br><color style='color:#FFD780;'>浄焔剣獄</color><br>領域内にいる敵がダメージを受けた時、「浄焔剣獄」はディシアの攻撃力とHP上限を基に連携攻撃を行って、その敵に<color style='color:#FF9999;'>炎元素範囲ダメージ</color>を与える。この効果は2.5秒毎に1回のみ発動可能。<br>領域内フィールド上キャラクターの中断耐性をアップさせ、それらのキャラクターがダメージを受けた際に、その一部のダメージをカットして「赤鬣の血」に蓄積させ、ディシアが10秒間肩代わりする。「赤鬣の血」に蓄積されたダメージ量が、ディシアのHP上限の一定割合に到達または超過した時、ダメージカットが行われなくなる。<br><br>ディシア自身が生成した「浄焔剣獄」は1つのみ存在可能。<br><br><i>この赤焔の試練を共に乗り越え、不浄を焼却しよう。燃え盛りし光の獣は、必ずや焚灼より降臨せん。</i>",
